y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1710113","type":"CustomJS"},{"attributes":{"border_line_color":"#333333","click_policy":"hide","coordinates":null,"group":null,"items":[{"id":"1710089"},{"id":"1710110"}],"label_text_font_size":"8pt","location":"top_left","margin":0,"padding":5,"spacing":0},"id":"1710088","type":"Legend"},{"attributes":{},"id":"1709865","type":"Selection"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/uiYOrOQE8D9kMFXhdSPwP+q5AFF7nPA/cybXIM258D/6fcQWF2PwPwPfe+RAg/A/DIUWPoxk8D99KUpufnfwPyu1Jdd+RvA/mehng7dT8D+b0tpyPm3wPwJhdkMZUfA/ni+Jwk1P8D9CGdHgMFXwP+UCGf8TW/A/4maExjJm8D/eyu+NUXHwPyWef8oXffA/d0XNsIFn8D8hMP21NjHwPyRvAtFoavA/wtJCx+Nh8D+hJ+eJvKTwP85g1R7LevA/kouz5wdt8D/S6iFw3XLwP+wEzC3B4vA/P9GyRCC88D+2zuuUtgzxP6dFuvVTQfE/K9b3ga4s8T9xD9pcSWvxP4VH/fBRSfE/ft9GaqRU8T9xD9pcSWvxP7ZIvDfkqfE/xBgpRT+T8T/CogBkOFzxP8h04F7SXvE/oKNNl/5L8T8Ier0IDjjxP6eWZ9cdAPE/8IRrO1P78D/lClfoxAzxP+Uz9yfok/A/TX07hE818D8wRS/5WBfwP3oVBaZF8O8/kGFYHfi67z8mEMPze7fvP+MtpKhcfe8/t3XzVfVw7z/GOIyGKx/wP5hOZ5BCDvA/CIQpMD/87z+dcFY4kZbvP04qwda0iO8/noE4A2tS7z85DmPGI27vP+gh+qk5du8/l0ZzWCk67z9H55uh8jfvP4VXIp7Vs+4/cyWSNj5E7j/3ptnQTRruP+OPkqIHGu4/HD7ZGK0/7j/w7CwPVR7uP+gDTSrnQu4/2GtqJHug7j8Q4NPWsLHuP4ED79Q6cu4
